{"attributes":{"args":{"ohlc_range":{"id":"2461733"},"source":{"id":"2461763"},"volume_range":{"id":"2461970"}},"code":"if (!window._bt_scale_range) {\n    window._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2462114","type":"CustomJS"},{"attributes":{},"id":"2462051","type":"Selection"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/Mm3E+pu87z+sXTua6BjwP1PMT9bZDPA/2RilVwQA8D/gatY+gQXwP8Ojn3RT/+8/R0jazRAO8D/n8FVRkUHxP/GUPViysvA/+o0bI3668D+54w1j5LLwP1+6psaflvA/dA/8a9q98D/0D58F88DwPw/LCcJsvfA/M85B+Jno8D+/G/O2qezwP6VDuu++0fA/rrNDMtur8D+C+LX3ZsnwP55XHXrJrvA/GDY9vvq18D+b2/YZbYfwP46As9iSa/A/rgip3P4k8D9y/3a5xhfwP+ewInupLfA/tfCGhpbU7z+lrDZyKsjvP0MsW7C7pe8/RS9zaHfS7z8uXivnawPwP7Ehm1ieF/A/NnOcaS8z8D/L
